window.bookSummaryJSON = "<p><b>It's time for Raysha to embrace her power.</b></p> <p>After an arduous journey to integrate an ancient spirit heart into her core, Raysha sets out to prove her worth in the Academy's tournament.</p> <p>Raysha must find a path, forge her own techniques, and advance to the Initiate. As the clock ticks down to the start of the contest, will she be able to prepare and overcome the fierce competition from the student elite? Can she control the vast ocean of aeon with sheer stubbornness and claim victory?</p> <p>Provided the tournament is a straightforward content of will and power, Raysha is determined to find a way. Political incidents, internal and international, are something she'd like to stay in her past.</p>"; 
